import "./Home.css";
import NavBar from "../src/Components/NavBar/NavBar";
import { Outlet } from "react-router-dom";
import ItemServicios from "./Components/ItemServicios/ItemServicios";
import Footer from "./Components/Footer/Footer";

const Home = () => {
  const ItemServicio = [
    {
      image: "",
      nombre: "Nombre",
      texto:
        "Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500",
      price: "$90.000.00",
    },
    {
      image: "",
      nombre: "Nombre",
      texto:
        "Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500",
      price: "$90.000.00",
    },
    {
      image: "",
      nombre: "Nombre",
      texto:
        "Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500",
      price: "$90.000.00",
    },
    {
      image: "",
      nombre: "Nombre",
      texto:
        "Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500",
      price: "$90.000.00",
    },
  ];
  return (
    <>
      <header>
        {" "}
        <NavBar />{" "}
      </header>
      <main>
        <Outlet />
        {/* Inicio Banner  */}
        <div className="contain-banner">
          <div className="banner-text">
            <div className="banner-text-title">
              Lorem Ipsum es simplemente el texto de relleno
            </div>
            <div className="banner-text-body">
              {" "}
              Lorem Ipsum es simplemente el texto de relleno de las imprentas y
              archivos de texto. Lorem Ipsum ha sido el texto de relleno
              estándar de las industrias desde el año 1500
            </div>
          </div>
          <div className="banner-img">
            <h1></h1>
          </div>
        </div>
        {/* Fin Banner */}
        {/* Inicio Conoce nuestros servicios */}
        <div className="conoce-nuestros-servicios">
          <div className="conoce-nuestros-servicios-titulo">
            <span>Conoce nuestros servicios</span>
          </div>
          <div className="conoce-nuestros-servicios-body">
            {" "}
            <span>
              {" "}
              Explora la gran variedad de servicios que Nombre tiene para ti.
            </span>
          </div>
          {/* items */}
          <ItemServicios item={ItemServicio} />
        </div>
        {/* Fin Conoce nuestros servicios */}
      </main>
      <Footer />
    </>
  );
};

export default Home;
